import React, { useState } from "react";
import ReactCalendar from "react-calendar"; // Import the react-calendar library
import 'react-calendar/dist/Calendar.css'; // Import CSS for the calendar
import {
  Container,
  Typography,
  Card,
  CardContent,
  CardActions,
  Button,
  Grid,
  Tooltip,
  Badge,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  FormControlLabel,
  Switch,
  Divider,
  TextField,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
} from "@mui/material";
import NotificationsIcon from "@mui/icons-material/Notifications";
import AddIcon from "@mui/icons-material/Add";
import { format, parseISO } from "date-fns";

function UserDashboard() {
  const [communications, setCommunications] = useState([
    {
      company: "Company 1",
      type: "LinkedIn Post",
      date: "2023-09-01",
      isPast: true,
      comments: "Follow-up on engagement insights."
    },
    {
      company: "Company 2",
      type: "Email",
      date: "2023-10-20",
      isPast: true,
      comments: "Sent project update and requested feedback."
    },
    {
      company: "Company 3",
      type: "Phone Call",
      date: "2024-01-15",
      isPast: false,
      comments: "Prepare for the quarterly performance discussion."
    },
    {
      company: "Company 4",
      type: "LinkedIn Message",
      date: "2024-02-10",
      isPast: false,
      comments: "Message sent to explore collaboration opportunities."
    }
  ]);

  const [selectedDate, setSelectedDate] = useState(new Date());
  const [dialogOpen, setDialogOpen] = useState(false);
  const [newCommunication, setNewCommunication] = useState({
    company: "",
    type: "",
    date: format(new Date(), "yyyy-MM-dd"),
    comments: "",
  });

  const [overdueCount] = useState(1);

  const openDialog = () => setDialogOpen(true);
  const closeDialog = () => setDialogOpen(false);

  const handleNewCommunicationChange = (field, value) => {
    setNewCommunication((prev) => ({ ...prev, [field]: value }));
  };

  const addNewCommunication = () => {
    setCommunications((prev) => [
      ...prev,
      {
        ...newCommunication,
        isPast: new Date(newCommunication.date) < new Date(),
      },
    ]);
    closeDialog();
  };

  const getRowColor = (date) => {
    const today = new Date().toISOString().slice(0, 10);
    const commDate = new Date(date).toISOString().slice(0, 10);
    if (commDate < today) return "#f8d7da"; // Red for overdue
    if (commDate === today) return "#fff3cd"; // Yellow for due today
    return "#ffffff"; // White for future dates
  };

  return (
    <Container>
      <Grid container alignItems="center" spacing={2} marginBottom={2}>
        <Grid item>
          <Badge
            badgeContent={overdueCount}
            color="error"
            overlap="circular"
          >
            <NotificationsIcon fontSize="large" />
          </Badge>
        </Grid>
        <Grid item>
          <Typography variant="h4">User Dashboard</Typography>
        </Grid>
      </Grid>

      {/* Communications Table */}
      <Paper sx={{ marginTop: 4 }}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell><strong>Company Name</strong></TableCell>
              <TableCell><strong>Last Communication</strong></TableCell>
              <TableCell><strong>Date</strong></TableCell>
              <TableCell><strong>Actions</strong></TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {communications.map((comm, index) => (
              <Tooltip
                key={index}
                title={comm.isPast ? comm.comments : "No notes available"}
                arrow
              >
                <TableRow style={{ backgroundColor: getRowColor(comm.date) }}>
                  <TableCell>{comm.company}</TableCell>
                  <TableCell>{comm.type}</TableCell>
                  <TableCell>{new Date(comm.date).toLocaleDateString()}</TableCell>
                  <TableCell>
                    <Button
                      variant="contained"
                      color="primary"
                      startIcon={<AddIcon />}
                      onClick={openDialog}
                    >
                      Log Communication
                    </Button>
                  </TableCell>
                </TableRow>
              </Tooltip>
            ))}
          </TableBody>
        </Table>
      </Paper>

      {/* Add Communication Dialog */}
      <Dialog open={dialogOpen} onClose={closeDialog}>
        <DialogTitle>Log New Communication</DialogTitle>
        <DialogContent>
          <TextField
            fullWidth
            margin="dense"
            label="Company"
            value={newCommunication.company}
            onChange={(e) => handleNewCommunicationChange("company", e.target.value)}
          />
          <TextField
            fullWidth
            margin="dense"
            label="Type"
            value={newCommunication.type}
            onChange={(e) => handleNewCommunicationChange("type", e.target.value)}
          />
          <TextField
            fullWidth
            margin="dense"
            label="Date"
            type="date"
            value={newCommunication.date}
            onChange={(e) => handleNewCommunicationChange("date", e.target.value)}
          />
          <TextField
            fullWidth
            margin="dense"
            label="Comments"
            multiline
            rows={3}
            value={newCommunication.comments}
            onChange={(e) => handleNewCommunicationChange("comments", e.target.value)}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={closeDialog}>Cancel</Button>
          <Button onClick={addNewCommunication} variant="contained" color="primary">
            Save
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
}

export default UserDashboard;
